description.excerpt:
RetinaNet is an efficient one-stage object detector trained with the focal loss. This repository is a TensorFlow2 implementation of RetinaNet and its applications, aiming for creating a tool in object detection task that can be easily extended to other datasets or used in building projects. It includes 
source code of RetinaNet and its configuration (multiple GPUs training and detecting); 
source code of data (RetinaNet's inputs) generator using multiple CPU cores;  
source code of utilities such as image/mask preprocessing, augmetation, average precision (AP) metric, visualization and so on; 
jupyter notebook demonstration using RetinaNet in training and real-time detection on some datasets.
